import React from 'react';

function Home() {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <section id="hero" className="d-flex align-items-center" style={{ borderRadius: 'none' }}>
        <div className="container position-relative" data-aos="fade-up" data-aos-delay="500">
          <h1>La forma más simple de gestionar tus envíos</h1>
          <h2>¿Querés saber dónde está tu paquete?</h2>
        </div>
      </section>
      {/* Otros elementos */}
    </div>
  );
}

export default Home;
